INSERT INTO `task_template` (`id`, `name`, `detail`, `subNames`, `counts`, `maps`, `contentInfo`, `killId`, `type`, `npc_quest`) VALUES
(1, 'Nhiệm vụ tập luyện', 'Mộc nhân được đặt nhiều tại Làng,\r\nngay trước nhà\r\nHãy đánh ngã 5 mộc nhân, sau đó quay\r\nvề nhà báo cáo với #home\r\nĐể đánh, hãy click đôi vào đối tượng\r\n-Thưởng 500 sức mạnh\r\n-Thưởng 500 tiềm năng', 'Đánh ngã 5 mộc nhân\r\nBáo cáo với #home', '5_-1', '0_7_14\r\n21_22_23', 'Đánh ngã 5 mộc nhân\r\nChúc mừng bạn, giờ hãy quay về báo cáo với #home', '0_-1', 0, '-1_home'),
